<!DOCTYPE html>
<html lang="en">

<head>

    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta name="description" content="valuemee">
    <meta name="keywords" content="valuemee">
    <meta name="author" content="valuemee">
    <title>Valuemee</title>

    <!--Google font-->
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/semantic-ui/2.4.1/semantic.min.css" integrity="sha512-8bHTC73gkZ7rZ7vpqUQThUDhqcNFyYi2xgDgPDHc+GXVGHXq+xPjynxIopALmOPqzo9JZj0k6OqqewdGO3EsrQ==" crossorigin="anonymous" referrerpolicy="no-referrer" />

    <link id="change-link" rel="stylesheet" type="text/css" href="{% static 'css/all.min.css' %}">

    <link id="change-link" rel="stylesheet" type="text/css" href="{% static 'css/adminlte.min.css' %}">

<body class="hold-transition register-page login-page">

    {% block content %}
    
    
    {% endblock content %}


<script src="{% static 'js/jquery-3.6.0.min.js' %}"></script>

<!-- popper js-->

<!-- feather icon js-->

<script src="{% static 'js/theme-setting.js' %}"></script>

<script src="{% static 'js/script.js' %}"></script>

<script>
    feather.replace();
    new WOW().init();
</script>

</html>
